pragma solidity 0.6.12;

contract SimpleTest{
    uint256 _a;
    uint256 _b;

    constructor() public {
        _a = 0;
        _b = 0;
    }

    function setA(uint256 v) public {
        _a = v;
    }

    function setB(uint256 v) public {
        _b = v;
    }

    function sum() public view returns (uint256){
        return _a + _b;
    }

    function product() public view returns (uint256){
        return _a * _b;
    }
}
